import React, { useState } from 'react';
import { View, Text } from 'react-native';
import TextInputField from './textInputField';
import PickerField from './pickerField';
import RegisterPressable from './RegisterPressable';
import Form from '../shared/form';

const fields = [
  { label: 'User Name', state: 'username', placeholder: 'Enter your email' },
  { label: 'First Name', state: 'firstName', placeholder: 'Enter your firstName' },
  { label: 'Last Name', state: 'lastName', placeholder: 'Enter your lastName' },
  { label: 'Phone Number', state: 'phoneNumber', placeholder: 'Enter your phoneNumber' },
  { label: 'Password', state: 'password', placeholder: 'Enter your password', secureTextEntry: true },
];

const userTypeOptions = [
  { label: 'Select User Type', value: '' },
  { label: 'Therapist', value: 'therapist' },
  { label: 'Treated', value: 'treated' },
];

export default function RegistrationForm() {
  const [userDetails, setUserDetails] = useState({
    username: '',
    firstName: '',
    lastName: '',
    phoneNumber: '',
    password: '',
  });
  const [userType, setUserType] = useState('');

  const handleFieldChange = (field, value) => {
    setUserDetails((prevDetails) => ({ ...prevDetails, [field]: value }));
  };

  const handleRegister = () => {
    // Implement registration logic here
    //check validations / wran user
    //save data / send to server
    console.log('Registering user:', { ...userDetails, userType });
  };

  return (
    <View>
      <Form fields={fields} userTypeOptions={userTypeOptions} ></Form>
    </View>
  );
}
